import React from 'react';
import { useHistory } from 'react-router-dom';

function MainButton() {
  let history = useHistory();

  function navigateToMainPage() {
    history.push('/main'); // '/main' 경로로 이동
  }

  return (
    <button onClick={navigateToMainPage}>
      Main
    </button>
  );
}

export default MainButton;
